import React from 'react';
import { Container, Row, Col, Nav } from 'react-bootstrap';

const AuthorizationList = () => {

  return (
    <>
      <Container className="container-wrap p-5 mb-4">
        <Row>
          <Col className="mb-3">
            <Nav variant="tabs" defaultActiveKey="/work/authorization">
              <Nav.Item>
                <Nav.Link href="/work/authorization">결재 대기</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link eventKey="link-1">결재 완료</Nav.Link>
              </Nav.Item>

            </Nav>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default AuthorizationList;
